@jake_wooten redefines the term ‘ATV’. Jake's famous frontside Ollies and his massive, malicious attacks on transition make him a threat on any vert wall, but in this Raw & Uncut we truly see how Jake is just as well rounded in the streets as he is in the parks. From his hometown of Gallatin, Tennessee to Argentina and Australia, Jake leaves his mark on each and every spot he comes across, stopping at nothing to roll away from mind melting maneuvers and crazy body contortions, all executed with his one of a kind of style. Welcome to the Pro Ranks, Jake! Hit up our @youtube channel to watch now!
