Today we are stoked to talk about and put to the test the 8.25 x 31.8 Contra All Over Dot Deck! This board features a 14.1 wheelbase to get your spins and flips whipped around quickly and consistently. Pair that wheelbase with this rad graphic and you'll be ready to rip in no time! We are also skating some rad @nopattern @mobgrip featuring artwork by our friend Chuck Anderson! Be sure to stop by your local shop and see if they have this one available. We put Santa Cruz Skateboards Brand Manager @andrewcannon to the test with three different challenges to find out how this setup skates! Hit up our @youtube channel to watch now, then let us know in the comments below what challenges we should throw in the bins next!
